import { Link } from "react-router-dom";

const DUMMY_Events = [
    {
        id:'e1',
        title:'Some event',
    },
    {
        id:'e2',
        title:'Some event 2',
    },
];


function EventsPage()  //1
{
    return (
    <>
     <h1>Event Page</h1>
     <ul>
        {DUMMY_Events.map(event => 
        <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
        </li>
        )}
     </ul>
    </>
   
    )
}

export default EventsPage;
